import React from 'react';
import './Footer.css'; // You can create a CSS file for styling

function Footer() {
  return (
    <footer className="footer">
      <p className="footer-text">Created with ❤️ by Janvi Gurjar</p>
    </footer>
  );
}

export default Footer;
